"use strict";function setCookie(e,t,o){var r=new Date;r.setDate(r.getDate()+o),document.cookie=e+"="+t+";expires="+r.toString()}function removeCookie(e){setCookie(e,1,-1)}function getCookie(e){for(var t=document.cookie.split("; "),o=0;o<t.length;o++){var r=t[o].split("=");if(r[0]==e)return r[1]}}function numArr(){for(var e=JSON.parse(localStorage.getItem("cart")),t=0,o=0;o<e.length;o++)t+=e[o].num;return t}$(".numArr").html(numArr());